import React, { useState } from 'react'
import './ArticlePage.css'

export function ArticlePage() {
  const [data, setData] = useState({ title: 'LOrem', descr: '', src: './assets/registration_banner.png', 
    categories: ['Symptoms', 'Causes', 'Diagnosis'], text: '' })

  return (
    <div className='page_wrapper'>
      <h1>{data?.title}</h1>
      <div>{data?.categories?.map((category, i) => <p>{category}</p>)}</div>
      <p>{data.text}</p>
    </div>
  )
}
